import{_ as s,r,o as d,c as l,b as e,d as t,e as o,w as c,a as n}from"./app.f88ccf77.js";const h={},u=n('<h1 id="updating-your-psp" tabindex="-1"><a class="header-anchor" href="#updating-your-psp" aria-hidden="true">#</a> Updating your PSP</h1><p>Before doing anything, it is recommended that you are in the <strong>latest firmware</strong> for your PSP. At the time of writing, the latest firmware is <strong>6.61</strong>.</p><p>Check if you are at the latest firmware. Go to <code>System Settings&gt;System Information</code>. Check if you are running System Software 6.61.</p><p>If you are running 6.61, proceed to the next page. If you are running anything below 6.61, keep following the guide.</p><h3 id="you-can-download-firmwares-below" tabindex="-1"><a class="header-anchor" href="#you-can-download-firmwares-below" aria-hidden="true">#</a> You can download firmwares below</h3>',5),m={href:"http://du01.psp.update.playstation.org/update/psp/image/us/2014_1212_6be8878f475ac5b1a499b95ab2f7d301/EBOOT.PBP",target:"_blank",rel:"noopener noreferrer"},p={href:"http://du01.psp.update.playstation.org/update/psp/image2/us/2014_1212_fd0f7d0798b4f6e6d32ef95836740527/EBOOT.PBP",target:"_blank",rel:"noopener noreferrer"},f=n('<h2 id="installing-the-firmware" tabindex="-1"><a class="header-anchor" href="#installing-the-firmware" aria-hidden="true">#</a> Installing the firmware.</h2><h3 id="prerequisites" tabindex="-1"><a class="header-anchor" href="#prerequisites" aria-hidden="true">#</a> Prerequisites:</h3><ul><li>You will need a <strong>Memory Stick Pro Duo</strong> card with enough space for games at homebrew. We recommend at least 8GB. Do note that these are proprietary memory cards and while they might look similar to SD cards, they are <strong>NOT</strong> SD cards. There are third party chinese adapters that convert MicroSD cards to Memory Stick Pro Duo, although reliability may vary. We recommend using an original Memory Stick Pro Duo.</li><li>You will also need a <strong>Mini-USB</strong> cable. These cables are widely available and shouldn&#39;t be hard to find.</li></ul><h3 id="how-to-update" tabindex="-1"><a class="header-anchor" href="#how-to-update" aria-hidden="true">#</a> How to update</h3><ol start="0"><li>(OPTIONAL) It&#39;s always best to format your memory card for good luck. Go to <code>System Settings&gt;Format Memory Stick</code> and wait for it to finish.</li><li>Connect your PSP to your computer using a Mini-USB cable and go to the USB mode under Settings if not done automatically.</li><li>Go to <code>Memory Stick&gt;PSP&gt;GAME</code> and create a new folder named <code>UPDATE</code> in all capital letters.</li><li>Copy the <code>EBOOT.PBP</code> of the update file that you downloaded from the links above and paste it into the <code>UPDATE</code> folder.</li><li>Now safely disconnect the PSP from your computer.</li><li>Connect your charger to the PSP</li><li>From your PSP, go to <code>Game Menu&gt;Memory Stick</code> and select <code>PSP UPDATE</code></li><li>Follow the on-screen instructions to install the firmware update.</li><li>After the PSP restarts and you&#39;re back in the menu, go <code>System Settings&gt;System Information</code> and check your <code>System Version</code>. It should say 6.61.</li></ol>',5),g={class:"custom-container tip"},y=e("p",{class:"custom-container-title"},"TIP",-1);function P(w,S){const a=r("ExternalLinkIcon"),i=r("RouterLink");return d(),l("div",null,[u,e("ul",null,[e("li",null,[e("a",m,[t("6.61 for PSP 1000, 2000, 3000, Street"),o(a)])]),e("li",null,[e("a",p,[t("6.61 for PSP Go"),o(a)])])]),f,e("div",g,[y,e("p",null,[t("Done updating? Proceed to the "),o(i,{to:"/page3.html"},{default:c(()=>[t("next step")]),_:1}),t(".")])])])}var b=s(h,[["render",P],["__file","page2.html.vue"]]);export{b as default};
